import { PlayerWrapper, PlayerLeft, PlayerRight } from "./style";

export default memo(function LJPlayerInfo() {
  return (
    <PlayerWrapper>
      <PlayerLeft></PlayerLeft>
      <div className=""></div>
      <PlayerRight className=""></PlayerRight>
      <div className=""></div>
    </PlayerWrapper>
  );
});
